import React from "react";

export default class Table extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      title: props.title,
      columnHeaders: [""].concat(props.exchanges),
      rows: props.rows
    };
  }

  renderTableHeader(header) {
    return (
      <th>header</th>
    );
  }

  renderRow(row) {
    return (
      <Row row={row}/>
    )
  }

  render() {
    const { title, columnHeaders, rows } = this.state;
    return (
      <div>
        <h1>{title}</h1>
        <table>
          <tr>
            {columnHeaders.foreach(h => this.renderTableHeader(h))}
          </tr>
          { rows.forEach(row => this.renderRow(row)) }
        </table>
      </div>
    );
  }
}

function Row(props) {
  const rowItems = props.row.map((item) =>
  <td>{item}</td>
);
  return rowItems;
}
